int get_exception_type(int errorCode) {
	int exceptionType;

	switch(errorCode) {
	case LASSO_PROFILE_ERROR_INVALID_QUERY:
		exceptionType = SWIG_SyntaxError;
		break;
	default:
		exceptionType = SWIG_UnknownError;
		break;
	}
	return exceptionType;
}


